import React from "react";
import styles from "../Dialogs/Dialogs.module.css";

const Dialogs = () => {
    return (
        <div className={styles.dialogs}>
            <div className={styles.dialogsItem}>
                <div className={styles.dialog}>Leo</div>
                <div className={styles.dialog}>Mark</div>
                <div className={styles.dialog}>Alf</div>
                <div className={styles.dialog}>Bean</div>
                <div className={styles.dialog}>Bill</div>
            </div>
            <div className={styles.messages}>
                <div className={styles.messa}>Hello!</div>
            </div>
        </div>
    );
};

export default Dialogs;
